import React from 'react';
import styled from 'styled-components';


const ContactCard = (props) => {
    return (
        <Container>
        <ContactCardContainer>
            <Icon>
                <img src={props.Img} alt={props.alt} ></img>
            </Icon>
            <IconTitle>
                <h4>{props.IconTitle}</h4>
            </IconTitle>
            <Content>
                <p>{props.Content}</p>
            </Content>
            <Contacts>
                <p>{props.Contact}</p>
            </Contacts>
        </ContactCardContainer>
        <ContactCardContainer>
            <Icon>
                <img src={props.Img} alt={props.alt} ></img>
            </Icon>
            <IconTitle>
                <h4>{props.IconTitle}</h4>
            </IconTitle>
            <Content>
                <p>{props.Content}</p>
            </Content>
            <Contacts>
                <p>{props.Contact}</p>
            </Contacts>
        </ContactCardContainer>

        </Container>
        
    )
};

const Container = styled.div`
display: flex;
flex-direction: row;
padding: 0 200px;
justify-content: center;`


const ContactCardContainer =styled.div`
background-color: #f5f5f5;
width: 500px;
height: 400px;
text-align: center;
padding: 20px;
margin: 10px;


p {
    font-family: 'Poppins', sans-serif;
    color: #033B4A;
    font-size:15px;
    font-weight: 400;
    line-height: 27px;
    font-wrap: break-word;
    margin: 10px;
    text-align: center;
}

h4 {
    font-family: 'Poppins', sans-serif;
    font-size: 20px;
    font-weight: 400;
    line-height: 35px;
    color: rgb(59, 94, 103);
}

img {
    max-width: 30px;
    max-height: 30px;
}

`

